import { LoaderDiv } from './Loader.style'

import loaderImg from 'Assets/images/Line-Preloader.gif'

export default function Loader(props) {
  return (
    <LoaderDiv {...props}>
      <img src={loaderImg} alt='Loading...' />
    </LoaderDiv>
  )
}
